import React from 'react'

import './CustomButton.scss'

const CustomButton = ({ children, ...otherProps }) => (
  <button className='custom-button' {...otherProps} onClick={() => console.log({...otherProps})}>
    {children}
  </button>
)

export default CustomButton;
